// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./Token.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Forging is Ownable {
    Token private ERC1155Contract;

    function setERC1155Contract(address contractAddress) public onlyOwner {
        ERC1155Contract = Token(contractAddress);
    }

    function tradeToken(uint256 indexId) view external {
        require(address(ERC1155Contract) != address(0), "ERC1155Contract address is not set");
        require(indexId == 3 || indexId == 4 || indexId == 5 || indexId == 6, "Invalid Option!");

        ERC1155Contract.mintBurnTokens(indexId);
    }

    function burnToken(uint256 indexId) external {
        require(address(ERC1155Contract) != address(0), "ERC1155Contract address is not set");
        require(indexId >= 3 && indexId <= 6, "Invalid Option!");

        ERC1155Contract.burnTokens(indexId);
    }
}
